package org.piglets.static_data;

import org.springframework.stereotype.Component;
import org.telegram.telegrambots.meta.api.objects.InputFile;

import java.io.ByteArrayInputStream;
import java.util.Base64;

@Component
public class Photos {
    public static final String BLACK_PIG_BASE64 = "";
    public static final String WHITE_PIG_BASE64 = "";
    public static final String PINK_PIG_BASE64 = "";

    public InputFile getBlackPig() {
        return new InputFile(new ByteArrayInputStream(Base64.getDecoder().decode(BLACK_PIG_BASE64)), "black_pig.png");
    }

    public InputFile getWhitePig() {
        return new InputFile(new ByteArrayInputStream(Base64.getDecoder().decode(WHITE_PIG_BASE64)), "white_pig.png");
    }

    public InputFile getPinkPig() {
        return new InputFile(new ByteArrayInputStream(Base64.getDecoder().decode(PINK_PIG_BASE64)), "pink_pig.png");
    }

}
